Announcement.create(title: "First Announcement", body: "Bushwick Neutra messenger bag PBR, aesthetic scenester narwhal Pinterest. Twee +1 flannel jean shorts Marfa, vinyl paleo literally Portland. Tofu bespoke lo-fi meggings roof party, +1 art party Pitchfork. Viral Intelligentsia crucifix, before they sold out keffiyeh meggings ennui drinking vinegar DIY. 90's Odd Future fap, biodiesel meggings disrupt gluten-free High Life umami tote bag normcore. Artisan health goth chia disrupt Wes Anderson, tousled High Life mlkshk flannel. Vice craft beer Etsy, tattooed ethical scenester tofu shabby chic wolf blog.", image: "default.png")
